description:
Naked and Afraid Special

Travel Documentary hosted by Mark Halliley, published by Discovery Channel in 2013 - English narration


Information
------------------------------

Two survival teams are placed at opposing ends of the same jungle, where for 21 days they attempt to survive with no food, water or clothes. But will they rise to the challenge?

